> Indiana Catchings helps Fever force Game 5, beating Lynx 75-69 Indiana Fever's Tamika Catchings smiles as she walks off the court after the Fever’s victory over the Minnesota Lynx in Game 4 of the WNBA Finals basketball series, in Indianapolis, Sunday, Oct. 11, 2015. The Fever won 75-69 to force Game 5 on Wednesday in Minneapolis. (AP Photo/Michael Conroy) 
